import React from 'react';
import bullshit from "../images/turtle.svg";

const Home = () => {
    return (
        <div>
            <div></div>
            <img src={bullshit} alt="" style={{ position: 'relative', top: 0, left: 0 }} />
            <h1>Home</h1 >
        </div>
    );
};

export default Home;
